import logo from './logo.svg';
import './App.css';
import Container from '@mui/material/Container'
import AppBar from '@mui/material/AppBar'
import Toolbar from '@mui/material/Toolbar'
import Typography from '@mui/material/Typography'
import Navbar from './components/navbar/Navbar.js';
import { makeStyles, MenuItem, Grid } from '@mui/material';
import Showstudents from './components/showstudents/Showstudents.js';
import { Box } from '@mui/system';



function App() {
  return (
    <div className="App">
         <Container   maxWidth="sm"  >
           <Navbar/>


          <Grid container spacing={5} sx={{m:5}}> 

            <Grid item xs={12}  lg={8}>
            <Typography  variant="h3" color="inherit" sx={{p:10, mr:100}}> show students</Typography>
              <Box> <Showstudents/></Box>
              </Grid>
              <Grid item xs={12} lg={4}>
                <Typography variant="h3" color="inherit" sx={{p:10}}> Form will be here</Typography>
                <Box>
                  Form is here
                </Box>
                </Grid>
          </Grid>
       </Container>
    </div>
  );
}

export default App;
